import React from "react";
import ExerciseCard from "./ExerciseCard.tsx"; // Make sure this accepts movement_name!
import "./GroupedExercises.css";
export default function GroupedExercisesOnly({ groupedData }) {
  return (
    <div className="grouped-container">
      <div className="exercise-list">
        {groupedData.map((exercise, idx) => (
          <ExerciseCard
            key={idx}
            exercise_id={exercise.exercise_id}
            name={exercise.movement_name || `Exercise #${exercise.exercise_id}`}
            anatomyImg={`/anatomy/${exercise.movement_name
              .replace(/\s*[-–]\s*/g, "-")
              .replace(/\s+/g, "_")}.jpg`}
            exerciseImg={`/anatomy/${exercise.movement_name
              .replace(/\s*[-–]\s*/g, "-")
              .replace(/\s+/g, "_")}.jpg`}
            sets={exercise.sets}
            reps={exercise.reps}
            time={exercise.time}
            rest={exercise.rest}
            instructions={exercise.instructions}
          />
        ))}
      </div>
    </div>
  );
}
